"     <a class=\"medical medical_review\" href=\"UTD.htm?3/33/3610?source=related_link\">",
"      Treatment of male infertility",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"UTD.htm?22/2/22567?source=related_link\">",
"      Treatment of stage I seminoma",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"UTD.htm?27/30/28138?source=related_link\">",
"      Treatment of the Raynaud phenomenon resistant to initial therapy",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"UTD.htm?33/9/33945?source=related_link\">",
"      Use of granulocyte colony stimulating factors in patients with chemotherapy-induced neutropenia",
"     </a>",
"    </li>",
