var title_f19_49_20252="Definition positive TST in children";
var content_f19_49_20252=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F78596&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F78596&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Definitions of positive tuberculin skin test (TST) results in infants, children, and adolescents*",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Induration 5 mm or greater",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Children in close contact with known or suspected contagious people with tuberculosis disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Children suspected to have tuberculosis disease:",
"        <ul>",
"         <li>",
"          Findings on chest radiograph consistent with active or previous tuberculosis disease",
"         </li>",
"         <li>",
"          Clinical evidence of tuberculosis disease",
"          <sup>",
"           &Delta;",
"          </sup>",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Children receiving immunosuppressive therapy",
"        <sup>",
"         &loz;",
"        </sup>",
"        or with immunosuppressive conditions, including human immunodeficiency (HIV) infection",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Induration 10 mm or greater",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Children at increased risk of disseminated tuberculosis disease:",
"        <ul>",
"         <li>",
"          Children younger than&nbsp;four years of age",
"         </li>",
"         <li>",
"          Children with other medical conditions, including Hodgkin disease, lymphoma, diabetes mellitus, chronic renal failure, or malnutrition",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Children with likelihood of increased exposure to tuberculosis disease:",
"        <ul>",
"         <li>",
"          Children born in high-prevalence regions of the world",
"         </li>",
"         <li>",
"          Children who travel to high-prevalence regions of the world",
"         </li>",
"         <li>",
"          Children frequently exposed to adults who are HIV infected, homeless, users of illicit drugs, residents of nursing homes, incarcerated, or institutionalized",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Induration 15 mm or greater",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Children age&nbsp;four years or older without any risk factors",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * These definitions apply regardless of previous bacille Calmette-Gu&eacute;rin immunization; erythema alone at TST site does not indicate a positive test result. Tests should be read at 48 to 72 hours after placement.",
"     <br/>",
"     &Delta; Evidence by physical examination or laboratory assessment that would include tuberculosis in the working differential diagnosis (eg, meningitis).",
"     <br/>",
"     <span class=\"lozenge\">",
"      &loz;",
"     </span>",
"     Including immunosuppressive doses of corticosteroids or tumor necrosis factor-alpha antagonists.",
"    </div>",
"    <div class=\"reference\">",
"     From: American Academy of Pediatrics. Tuberculosis. In: Red Book: 2012 Report of the Committee on Infectious Diseases, 29th ed, Pickering LK (Ed), American Academy of Pediatrics, Elk Grove Village, IL 2012. Used with the permission of the American Academy of Pediatrics. Copyright &copy; 2012.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
