"    The chest radiograph of a patient with Ebstein anomaly shows a very large cardiac silhouette. The prominence of the right cardiac border represents a markedly dilated right atrium (red arrow). The left cardiac border, instead of displaying the usual outlines of the aortic arch and pulmonary artery trunk, is abnormally convex and protuberant due to the border-forming, laterally displaced, and dilated right ventricular outflow tract (white arrow); the aortic knot and pulmonary artery trunk are not visible. Intrapulmonary vessels are smaller and fewer than normal leading to reduced pulmonary flow.",
